INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(4, 'Churrasco a la plancha con puré de aguacate', , '4 bifets - 2 aguacates maduros - 50 gramos de mantequlla - jugo de 1 limón - sal - pimienta - aceite', 'Los bifets o churrascos no deben ser finos. \r\n\r\nPelar el aguacate, cortarlo a la mitad y quitarle la pepa. Colocar en un recipiente, se pisa con un tenedor formando un puré y se condimenta con sal, pimienta y jugo de limón. \r\n\r\nPisar la mantequilla y agregarla al puré de aguacate. \r\n\r\nAparte, se aplastan un poco los churrascos, se pincelan con aceite y se salan \r\n\r\nPoner en una plancha bien caliente untada con algo de aceite. Se cocinan hasta lograr el punto deseado, (jugoso, muy jugoso o a punto).\r\n\r\nAcomodar en una fuente de mesa y se cubren con el puré y se sirven enseguida.\r\n\r\nSe puede acompañar con ensaladas. ', '4', '1 hora', 'cena', 'Plato', 3, 7, 2, '2', 7, 28, 112, 23, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(5, 'Bifes a la criolla', , '6 Bifes de carne vacuna, 2 morrones rojos dulce (pimiento, ají dulce), 3 cebollas blancas medianas, 1 manojo de perejil o cilantro, 3 dientes de ajo, 1 hoja de laurel, 5 papas medianas, 4 tomates maduros y firmes, 1 taza de caldo, 1/2 taza de aceite, sal, pimienta, ají molido.', 'Golpear los bifes un poco para afinarlo. Después cortar los morrones en tiras finas y las cebollas en rodajas finas, junto con las papas. Picar el perejil o cilantro con los dientes de ajo. Colocar aceite en una cacerola y distribuir una capa de tomate, una capa de morrón, espolvorear con perejil y ajo picado y condimentos. Luego una capa de papas y bifes y continuar así hasta terminar y agregar el caldo. Cubrir la boca de la cacerola con papel aluminio y luego taparla, para que así no escape el vapor y se cocine sin perder sabores. Llevar a fuego moderado durante 20 minutos o hasta que las papas estén blandas.', '6', '1 hora y 30mins', 'cualquiera', 'Plato', 4, 13, 2, '2', 7, 5, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(6, 'Ropa Vieja Canaria', , '-1/2 Kg de garbanzos. -1/2 Kg  de carne de pollo. -1/2 Kg de carne de vaca. -1 Pimiento. -1 kg de papas, -1 Cebolla. -1 Tomate. -3 Dientes de Ajo. -1 Taza de caldo. -1 Tacita de vino blanco. -Pimenton, pimienta, tomillo, clavos, Laurel, Sal y Aceite', '-1.Ponemos los garbanzos ablandados de la noche anterior, junto con la carne, la sal y agua. Una vez guisado, escurrimos y desmenuzamos la carne.\r\n-2.Después freimos la carne y los garbanzos hasta que queden crujientes.\r\n-3.Hacemos un guiso con el aceite, la cebolla, el pimiento, el tomate y los ajos, todo picado, añadimos la pimienta y los clavos. Una vez listo el el guiso agregamos el pimentón, el vino, el tomillo, el laurel y el caldo. Luego añadimos la carne y los garbanzos y dejamos unos minutos al fuego.\r\n-4.Por último, freimos las papas en cuadritos y mezclamos todo.', '4', '3 horas', 'almuerzo', 'Plato', 4, 13, 3, '2', 7, 28, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(7, 'Albóndigas Caseras', , '-500 g de carne de ternera picada.\r\n-20 g de miga de pan. \r\n-3 Cebollas.\r\n-1 Vaso de leche.\r\n-2 Cucharadas de harina.\r\n-3 Dientes de ajo.\r\n-1 Huevo.\r\n-1 Vaso de caldo de carne.\r\n-1 Vaso de vino blanco.\r\n-Pimienta negra molida, Aceite, Sal, Perejil picado.', '-1.Mezclar la miga de pan con leche y dejar reposar. Luego bata el huevo, el perejil y los ajos previamente picados con la miga de pan.\r\n-2.Agregue sal y pimienta negra a la carne y añade lo anterior.\r\n-3.Con la masa resultante haga albóndigas. Páselas por harina y fríelas en aceite. Dóralas y guárdalas en un plato.\r\n-4.Pique las cebollas y dórelas en el mismo aceite donde frito las albóndigas. Añada 2 cucharadas de harina y mezcle bien.\r\n-5.Agregue el caldo de carne y el vino blanco y deje que se haga durante unos minutos.\r\n-6.Adicione las albóndigas en otra cazuela y vierte la salsa por encima. Deje a fuego lento durante 10 minutos. Pase la salsa por el pasapurés. \r\n-7.Ponga las albóndigas en una fuente grande para servir. ', '5', '2 horas', 'cualquiera', 'Snack', 4, 13, 2, '2', 7, 91, 28, 7, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(8, 'Flan con galletas', , '-Litro de leche. -6 huevos. -Paquete de galletas. -Caramelo líquido. -1 esencia de vainilla. -200g de azúcar', '-1.Se calienta en una cazuela el litro de leche mezclado con el azúcar y la vainilla. Cuando humea, antes de hervir, se echa la leche en un recipiente con los huevos y se baten bien quitando la esencia de vainilla.\r\n-2.Se añade caramelo líquido en el fondo de un molde rectangular y se echa la mitad de la mezcla, entonces ponemos galletas rotas sobre la capa de flan y encima el resto de la cantidad.\r\n-3.Se mete al horno, al baño María, unos 35 minutos a temperatura media.\r\n-4.Al sacarlo se desmolda dejando enfriar antes ', '5', '2 horas', 'cualquiera', 'Postre', 4, 13, 1, '2', 7, 48, 31, 7, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(9, 'Caldo de costilla.', , '-10 tazas de agua -3libras de costilla de res cortada en trozos -10 papas sabaneras peladas y cortada -1 taza de hogao -1/2 cucharadita de orégano y tomillo -Sal y comino al gusto -Cilantro picado y ají', '-Cocine las costillas durante 1 hora en una olla a presión -Agregue la papa y el resto de los ingredientes y deje cocinar durante 30 minutos. -Sirva con cilantro picado por encima y ají al gusto.', '5', '1:00', 'almuerzo', 'Plato', 4, 13, 2, '1', 10, 82, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(10, 'Changua ', , '-2 tazas de agua -6 tazas de leche -4 tallos de cebolla larga -4 ramas de cilantro -2 dientes de ajo pelados -8 huevos -4 calados o pan tostado -Cilantro y cebolla picados y mezclados -Sal al gusto ', '-Mezcle el agua con la leche, agregue la cebolla, los ajos, las ramas de cilantro y sal. Cocine por 15 minutos, luego retire la cebolla, el cilantro y los ajos. -Agregue uno por uno los huevos al caldo. Cocine a fuego bajo hasta que estén cocidos. -En cada plato, coloque un poco del picadito de cebolla y cilantro, y los trozos de calado al pan. -Vierta sobre ellos el caldo y sirva también un huevo en cada plato.', '4', '30 minutos', 'cualquiera', 'Plato', 1, 2, 4, '1', 10, 82, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(12, 'Caldo peligroso', , '-8 tazas de agua -! taza de hogao -2 libras de criadillas de toro -6 papas medianas, peladas y cortadas en rebanadas -Sal y pimienta al gusto - Cilantro picado finamente ', '-Mezcle el agua con el hogao y lleve al fuego. -Agregue las criadillas cortadas en rebanadas delgadas y deje hervir durante 30 minutos. Añada las papas y condimente con sal y pimienta al gusto. -Baje el fuego a medio y deje conservar por 30 minutos. -Sirva caliente, con cilantro picado por encima.', '4', '1 hora ', 'almuerzo', 'Plato', 4, 13, 2, '1', 10, 82, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(13, 'Ternera Salteada a la Naranja ', , '-300gr de filetes de ternera a tiras\r\n-Media guindilla\r\n-1 Cucharada de sake\r\n-3 Cucharaditas de jengibre picado\r\n-2 Cucharaditas de harina de maíz\r\n-4 Cucharaditas de salsa de soya\r\n-Piel de naranja rallada\r\n-1/2 Cucharadita de pimienta\r\n-1 Cucharada de azúcar morena\r\n-8 Cucharadas de aceite de sésamo\r\n-Sal', '-1.Corte la ternera en tiras, hacemos una mezcla con el sake, el jengibre, la harina de maíz, un poco de salsa de soya y dos cucharadas de aceite de sésamo.\r\n-2.Marine la ternera con esta mezcla durante de unos 40 minutos aproximadamente, freímos la carne y en el sartén tostamos las guindillas,  agregamos la piel de naranja, el azúcar, la sal y el resto de salsa de soya.\r\n-3.Mezcle todos los ingredientes luego añada la carne, saltee todo y sirva rápidamente.', '3', '2 horas', 'cena', 'Plato', 4, 13, 3, '2', 7, 35, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(14, 'Mojito de frambuesa', , '-2 oz de ron -1 oz de zumo de lima natural -1 oz de jarabe de azúcar -2-5 frambuesas -14 hojas de hierbabuena -Soda', '-Se machacan las frambuesas, zumo de lima, hierbabuena y jarabe de azúcar en el fondo del vaso, se llena el hielo granizado, se sirve el ron, remover todo con una cucharilla de bar y completar con soda, se decora con una frambuesa y ramita de hierbabuena ', '2', '10 minutos ', 'cualquiera', 'Bebida', 4, 13, 1, '1', 10, 28, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(16, 'Asado a la barbacoa', , '-1Kg lomo liso\r\n-1/2 cucharada de paprika\r\n-1/2 cucharada de tomillo\r\n-1/2 cucharada de pimienta\r\n-1/2 cuchara de sal \r\n-1/2 cebolla rallada\r\n-2 dientes de ajo machacado\r\n-2 cucharadas de aceite\r\n-3/4 taza de ketchup\r\n-1/4 taza de vinagre de manzana\r\n-1/8 taza salsa de worcestershire\r\n-1 cucharada de azúcar\r\n-1/2 cucharada de ají en polvo, sal y pimienta al gusto.', '-1.Freir cebolla y ajos. Luego incorporar ketchup, vinagre, salsa worcestershire, azúcar, ají en polvo, sal y pimienta. Luego reservar.\r\n-2.Luego pasar sobre el pedazo de carne un trozo de papel absorbente para sacar el exceso de su jugo. Hacer orificios pequeños en el trozo de la carne. Insertar láminas de ajo. Pincelar con aceite.\r\n-3.Mezclar páprika, tomillo, sal y pimienta.\r\n-4.Frotar con esta mezcla la carne y dejar tapado en el refrigerador por 1 hora\r\n-5.Pincelar la carne con la salsa de ketchup.\r\n-6.Poner sobre la parrilla con las brasas calientes y continuar pincelando a medida que se va cocinando.', '5', 'Más de 2 horas', 'cena', 'Plato', 4, 13, 3, '2', 7, 5, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(18, 'Postre Napoleón', , '-1 Un paquete de galletas ducales, -1 Lata de leche condensada grande -1 lata de crema de leche pequeña -1 Cucharadita de harina de trigo -1 Cucharadita maizena -3 tazas de leche ', '-1.Poner a hervir la leche junto con la leche condensada. Aparte debemos disolver la maizena y la harina en un poco de leche. Esto lo revolvemos muy bien.\r\n-2.Cuando retiremos del fuego inmediatamente debemos agregar la crema de leche. Esto lo dejamos enfriar muy bien. Después debemos coger un recipiente y le agregamos un poco de la mezcla de leche y encima una capa de galletas. Este procedimiento se realiza hasta que se acaben las galletas o la leche.\r\n-3.Luego debemos llevar la recipiente a la nevera y dejarla hasta el día siguiente, si queremos la podemos decorar con un merengue.', '3', '2 días', 'cualquiera', 'Postre', 4, 13, 5, '2', 7, 64, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(19, 'Pudin', , '-1 sobre de gelatina sin sabor -1kg de dulce de leche o arequipe pastelero -1 Taza de nueces picadas -1 Pocillo de agua -1 Crema de leche -12 unds de bizcochos tipo vainilla -Almíbar para humedecer los bizcochos -Para decorar: una taza tipo bizcochos tipo vainilla molidos -2 cucharaditas de azúcar -1 cucharada sopera de cacao ', '-1.Forrar el molde donde se prepara el pudín con vinipel. Aparte debemos hidratar la gelatina para luego disolverlo con baño maría. Después debemos batir la crema hasta el termino medio, luego la retiramos y le agregamos el dulce de leche o arequipe, esto debemos mezclarlo muy bien para después agregar la gelatina y poner a reservar \r\n-2.El paso a seguir es poner en el molde una capa bizcochos para luego bañarla en el almíbar, a esta le ponemos una capa de crema y les esparcimos un poco de nueces . Después ponemos otra capa de bizcochos y le volvemos a agregar más crema, otro poco de nueces y una capa más de crema.\r\n-3.La dejamos hasta que esté bien firme.\r\n-4.Aparte debemos mezclar todos los ingredientes del decorado para luego reservarlos.\r\n-5.Le quitamos el papel film y decoramos en la mezcla de la cubierta. Éste se debe servir frío\r\n\r\n', '4', '1 hora', 'cualquiera', 'Postre', 4, 13, 2, '2', 7, 13, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(20, 'Torta tres leches', , '-8 Huevos -240Gr de azúcar -240Gr de harina -1 Cucharadita de polvo de hornear -1 lata de 250gr de crema de leche -1 tarro de leche evaporada -1 lata de leche condensada -1 taza de azúcar -6 claras -1 taza de azúcar flor -Crema pastelera  ', '-1.Lo primero que se hace es batir las yemas de los 8 huevos junto con 120gr de azúcar, esto se hace hasta que la mezcla esté bien amarilla. \r\n-2.Aparte debemos batir las claras de los 8 huevos, estas las llevamos hasta el punto de nieve, junto con los otros 120gr de azúcar. Después agregamos la harina y el polvo de hornear, esto lo seguimos batiendo.\r\n-3.Después mezclamos todo muy bien y agregamos en un molde engrasado. Esto lo llevamos al horno unos 25 minutos.\r\n-4.La preparación del relleno. Lo primero que debemos hacer es dividir el bizcocho en tres capaz, después ponemos un disco en el molde.\r\n-5.Luego hacemos una mezcla con las 3 leches (crema de leche, condensada y evaporada). Aparte debemos preparar la mezcla pastelera.\r\n-6.Preparamos el merengue que ésta lleva con las 6 claras de huevo, a estas poco a poco le agregamos el azúcar. Luego debemos desmontar el postre en un plato y lo cubrimos con el merengue.\r\n-7.Dejamos unos cuantos minutos en el horno. Después llevamos al horno y dejamos de un día para otro. De esta manera obtendremos nuestra torta tres leches', '8', '2 días', 'cualquiera', 'Postre', 4, 13, 5, '2', 7, 42, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(21, 'CheeseCake', , '-13 cucharaditas de harina -2 Huevos -Cáscara de limón -1 Taza de azúcar -250gr de queso crema -200cc de crema de leche -Esencia de vainilla -Esencia de limón', '-1.En una batidora o licuadora agregar todos los ingredientes. Esto lo debemos mezclar muy bien.\r\n-2.Aparte debemos engrasar el molde con mantequilla y después enharinamos. Luego agregamos toda la mezcla en este. Y lo llevamos al horno previamente calentado a una temperatura de 180°. Esta la dejamos cerca de 50 minutos.\r\n-3.Para sacar esta del molde debemos dejar que se enfríe. Cuando esté tibia es el momento ideal para sacar del molde nuestro Cheesecake.\r\n-4.El cheesecake lo podemos decorar con lo que deseemos.', '3', '2 horas', 'cualquiera', 'Postre', 4, 13, 5, '2', 7, 20, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(22, 'Pie de limón', , '-2 tazas de galletas de vainilla molidas -1 taza de zumo de limón -1 lata de 14 oz de leche condensada -1 taza de mantequilla derretida -4 claras de huevo -4 yemas de huevo -1 taza de azúcar', '-1.Mezclar en un recipiente hondo la mantequilla junto con las tazas de galleta molida. Después presionamos esta mezcla contra el molde donde prepararemos el pie. Luego llevamos el molde al horno previamente calentado a 180° durante 15 minutos más o menos . Luego dejamos enfriar.\r\n-2.Aparte debemos mezclar la leche condensada junto con las yemas de huevo y el zumo de limón. Después de que esta mezcla esté lista se la agregamos a la corteza de galleta y llevamos por 15 minutos al horno. Luego sacamos y dejamos enfriar.\r\n-3.Luego batimos muy bien las claras, hasta que queden espumosas. A medida que batimos le vamos agregando el azúcar. Esto se mezcla hasta el punto de nieve.\r\n-4.La mezcla de las claras de huevo, se la agregamos encima del pie y decoramos con la ayuda de un cuchillo o un tenedor, ya por último volvemos a llevar al horno y dejamos hasta que dore.', '4', '1 hora', 'cualquiera', 'Postre', 4, 13, 5, '2', 7, 64, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(23, 'Pudín de pan', , '-4 tazas de migas de pan\r\n-2 huevos\r\n-3 tazas de leche caliente\r\n-1 cdta de vainilla\r\n-1/4 taza de manteca\r\n-1/2 taza de azúcar\r\n-1/2 cucharadita de sal', '-1.Lo primero que debemos hacer para el pudín de pan es poner en un recipiente hondo las migas de pan y después agregarle la leche caliente, después poco a poco se agrega la manteca derretida, la vainilla, la sal, el azúcar y los huevos previamente revueltos.\r\n-2.Después pasamos todo en un recipiente para horno previamente enmantecado y encaramelado.\r\n-3.Luego llevamos al horno por lo menos una hora a una temperatura promedia a los 160°.\r\n-4.Para preparar el caramelo lo que podemos hacer coger media taza de azúcar y mezclar con dos cucharadas de agua. Esto lo dejamos hornear unos 5 minutos o sencillamente hasta que quede color caramelo. Después ya queda listo para agregarlo al molde donde va el pudín de pan.\r\n', '4', '2 horas', 'cualquiera', 'Postre', 4, 13, 5, '2', 7, 13, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(24, 'Arroz con pollo', , '-1 pollo grande\r\n-1 kg de arroz\r\n-500 gr de habichuelas\r\n-500 gr de zanahoria\r\n-250 gr de arvejas\r\n-500 gr de salchichas\r\n-1 pimentón rojo\r\n-250 gr de cebolla\r\n-3 dientes de ajo\r\n-1 pizca de comino\r\n-2 cubos concentrados\r\nde caldo de gallina\r\n-1 cucharada de salsa de soja\r\n-500 gr de ketchup\r\nsalsa de tomate', 'Cocer durante 10 minutos en olla\r\nexpress el pollo en abundante agua\r\ncon los dos cubos de caldo, 1 cebolla,\r\n2 ajos y comino. Retira el pollo y con\r\nel mismo caldo cocer el arroz, dejar\r\nsudar.\r\nRehogar el diente de ajo con la cebolla\r\nfinamente picada hasta que se ponga transparente, agregar el pimentón\r\npicado, una pizca de comino y unas\r\ngotas de salsa de soja. Cuando el\r\nsofrito esté listo agregar la salchicha\r\ncortada en trozos:\r\nPor otro lado poner a cocer las verduras\r\nen agua con sal, zanahorias en cubitos,\r\nhabichuelas y arvejas; cuando estén\r\nlistas agregar al sofrito de salchicha.\r\nDeshuesar el pollo, desmechar o\r\nseparar con las manos e incorporar\r\nal sofrito con todos los ingredientes al\r\narroz, mezclar bien y poner por último\r\nla salsa de tomate o ketchup mezclar\r\nnuevamente. Servir', '8', '2 horas', 'almuerzo', 'Plato', 4, 13, 3, '2', 7, 82, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(25, 'Arroz con pollo y maiz', , '-1 taza de arroz integral cocinado\r\nen caldo de pollo\r\n-2 pechugas de pollo cocinadas\r\nen caldo de vegetales\r\n-2 cucharadas de aceite\r\n-1/4 taza de cebolla picadita\r\n-2 dientes de ajo\r\n-1/2 taza de tomate picadito\r\n-1/4 taza de pimentón rojo\r\n-1/4 taza de maíz\r\n-1/4 taza de arvejas SOM SO\r\n-1/4 taza de zanahoria rallada\r\n-Sal\r\n-Pimienta negra recién molida\r\n', 'Preparación\r\nCocinar las pechugas de pollo en caldo de vegetales. Cuando esté listo cortar el\r\npollo en tiritas o cuadritos.\r\nEn una olla cocinar el arroz integral con caldo de pollo, sal y pimienta. El arroz\r\nintegral tarda en cocinar un poquito más. Se hace 1 taza de arroz por 2 1/2 de\r\ncaldo.\r\nEn una olla se coloca el aceite y se cocina la cebolla, ajo, y pimentón. Luego se\r\nagrega el resto de los vegetales, el pollo, sal, pimienta y se cocina por 2 minutos\r\nmás.\r\nCuando el arroz este se combinan todos los ingredientes.', '8', '2 horas', 'almuerzo', 'Plato', 4, 13, 5, '2', 7, 82, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(26, 'Asado al Horno', , '-2Kg de lomo\r\n-6 dientes de ajo cortados en láminas\r\n-1/2 taza de jugo de limón\r\n-1/2 taza de jengibre pelado\r\n-Sal y pimienta al gusto', '1.Corte el jengibre en láminas. Luego haga cortes a la carne e insertar a intervalos 3 dientes de ajo cortados en láminas.\r\n2.Procese los ajos restantes con el jengibre, jugo de limón, sal y pimienta. Amarrar con pita la carne y frotar con el aliño anterior. Refrigerar un par de horas.\r\n3.Precalentar el horno a fuego fuerte. Hornear la carne aproximadamente por una hora o hasta que la carne esté cocida pero rosada al medio.', '5', 'Más de 3 horas', 'cualquiera', 'Plato', 4, 13, 3, '1', 7, 5, 22, 5, '');
INSERT INTO `tblreceta` (`recetaid`, `titulo`, `imagen`, `ingrediente`, `pasos`, `cantidadpersonas`, `tiempopreparacion`, `ocacion`, `tiporeceta`, `tipocomidaid`, `padecimientoid`, `tipodietaid`, `validar`, `usuarioid`, `paisid`, `votacionacomulada`, `numeroVotaciones`, `tags`) VALUES
(27, 'Jugo de Naranja para la gripa!!', , '-6 Naranjas\r\n-5 fresas o 4\r\n-1 trozo de jengibre fresco grande (en raíz)\r\n-1 rama de apio', '-1.Exprime el zumo de naranja en una jarra\r\n-2.Vierte el zumo de naranja en el vaso de la batidora y añade los tallos de apio troceados. Bate bien hasta que el apio se triture y mezcle con el resto del zumo.\r\n-3.Corta la fresa y el jengibre en rodajas y ponlas en una jarra. Vierte el zumo de naranja dentro y deja reposar en la nevera una hora antes de servir.\r\n-4.Sirve el zumo de naranja con jengibre para la gripe o el resfriado en ayunas o cuando te apetezca.', '3', '2 horas', 'cualquiera', 'Indefinido', 1, 12, 5, '1', 7, 35, 22, 5, '');
